window.bookSummaryJSON = "<p>Set in the post-plague society where women are nothing more than a man's property, bought for the purpose of repopulating the world, young Tria has been sold on the auction block to Thomas.</p> <p>Protected and trained until her 25th birthday, the young, innocent woman knows nothing of a man's desire. She quickly learns as her new owner has very distinct tastes when it comes to pain and pleasure. Embarrassed by the betrayal of her own body, Tria settles in to her new life as best she can.</p> <p>Her owner soon realizes his new acquisition is worth all he paid for her and more as he is amazed by her obvious response to his treatment of her. But will he continue to think that way if she is not able to produce the son he so desperately wants?</p>"; 
